### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Linear Regression and ANOVA**
- **Simple Linear Regression (SLR)**: Modeling the relationship between a dependent variable and one independent variable.
  - Equation: \( y = \beta_0 + \beta_1 x + \epsilon \)
- **Multiple Linear Regression (MLR)**: Modeling the relationship between a dependent variable and multiple independent variables.
  - Equation: \( y = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \dots + \beta_n x_n + \epsilon \)
- **ANOVA (Analysis of Variance)**: Used to analyze the differences among group means in a sample.
  - Degrees of Freedom (DF): Number of independent pieces of information.
  - Sum of Squares (SS): Measure of variation.
  - Mean Squares (MS): SS divided by DF.
  - F-statistic: Ratio of MS for regression to MS for residuals.

#### 2. **Logistic Regression**
- **Logistic Classification Model**: Used for binary classification problems.
  - Equation: \( \log\left(\frac{p}{1-p}\right) = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \dots + \beta_n x_n \)
  - Sigmoid Function: \( p = \frac{1}{1 + e^{-(\beta_0 + \beta_1 x_1 + \beta_2 x_2 + \dots + \beta_n x_n)}} \)
- **Performance Metrics**:
  - Accuracy: \( \frac{TP + TN}{TP + TN + FP + FN} \)
  - Precision: \( \frac{TP}{TP + FP} \)
  - Recall: \( \frac{TP}{TP + FN} \)
  - True Positives (TP), True Negatives (TN), False Positives (FP), False Negatives (FN)

#### 3. **Elasticity**
- **Price Elasticity of Demand**: Measures the responsiveness of the quantity demanded to a change in price.
  - Equation: \( E_d = \frac{\% \text{ change in quantity demanded}}{\% \text{ change in price}} \)
  - Constant Elasticity Model: \( Q = C \cdot P^{E_d} \)

